import { useEffect } from "react";
import useFetch from "./useFetch";
import Home from "./Home"

function App() {

  const {data, error, isLoding}=useFetch('https://restcountries.com/v2/all');

  return(
    <div className="container">
      {isLoding && <div className="text-6xl text-center pt-8">Data is loading</div>}
      {error && <div className="text-6xl text-center text-red-500 pt-8">{error}</div> }
      {data && <Home data={data}/>}
    </div>
  )

}

export default App;
